	 (549,2,TO_CLOB('Your system is the worst you should do betterüò°üò°üò°üò°üò°üò°'),2,TIMESTAMP'2024-12-11 00:00:00','Google Play'),
	 (550,2,TO_CLOB('It has been a while since you guys started giving the mobile app service but still couldn''t get it to work. I''m sure you know that it doesn''t work already but not sure if you''re lazy or incompetent to fix it. You are losing business because of this. Complacency will have consequences.'),1,TIMESTAMP'2024-12-10 00:00:00','Google Play'),
	 (551,2,TO_CLOB('This is the best app; many features are awesome, but it should work without the need to turn off the developer options. I''m tired of having to constantly switch the developer options off and on. I''ve been expressing my struggles about this. I have precious settings enabled in the developer options, and to open the App Boa app, I have to turn them off. Please help us, Abyssinia Bank. I hope you can provide an update soon.'),4,TIMESTAMP'2024-12-08 00:00:00','Google Play'),
	 (552,2,TO_CLOB('I‚Äôm giving this app one star because there are no options below that. My experience has been incredibly frustrating due to the extremely long loading times, and the app even closes automatically at times. People choose mobile banking for its convenience, but this app is far too time-consuming, making it the worst I‚Äôve used. I hope improvements are made to enhance the user experience.'),1,TIMESTAMP'2024-12-07 00:00:00','Google Play'),
	 (553,2,TO_CLOB('Nice'),5,TIMESTAMP'2024-12-07 00:00:00','Google Play'),
	 (554,2,TO_CLOB('Very unprofessional and mischievous bank in my opinion. I have had several occasions but recently I used Abyssinia Card to withdraw money and it was deducted from my account but despite reporting several times they said they are processing it but I learned yesterday that since it has been 3 months the bank has decided to include it in their income. How absurd. If you can avoid this bank.'),1,TIMESTAMP'2024-12-06 00:00:00','Google Play');
