	 (938,3,TO_CLOB('The app is incredibly handy for managing multiple financial tasks, from bill payments to managing budgets. It‚Äôs saved me a lot of time and made banking way more convenient. Definitely worth checking out!'),5,TIMESTAMP'2025-04-21 00:00:00','Google Play'),
