	 (982,3,TO_CLOB('I have been using the Dashen Supper app mobile banking app , and overall, I appreciate its features.However,I‚Äôve noticed that when I turn on the developer options on my device, the app stops functioning properly. It would be great if you could look into this issue, as I often need to access developer settings for other applications . Thank you for your attention to this matter!'),5,TIMESTAMP'2025-04-21 00:00:00','Google Play'),
	 (983,3,TO_CLOB('easiness to use with fast response time'),5,TIMESTAMP'2025-04-21 00:00:00','Google Play'),
	 (984,3,TO_CLOB('The new mobile banking application is a major upgrade! It‚Äôs incredibly user-friendly, with a clean and modern design that makes navigation simple and intuitive. I really appreciate how fast it loads and how smooth the overall experience is. All essential services like balance checks, transfers, and bill payments are eas y to find and use. The added security features give me peace of mind, and the app runs reliably without crashes or glitches. It‚Äôs clear a lot of thought went into the user experi'),5,TIMESTAMP'2025-04-21 00:00:00','Google Play'),
	 (985,3,TO_CLOB('As an Internal Customer, Dashen Bank SuperApp has greatly simplified my online banking experience. It''s easy to use, allowing me to quickly check balances, transfer money and pay Bills. The app''s advanced security features are highly secure, ensuring my data is well protected. The Three click, Chat Banking and IPS features have also given me a smarter experience. In deed Dashen Bank is always steping ahead!'),5,TIMESTAMP'2025-04-21 00:00:00','Google Play');
INSERT INTO BANK_REVIEWS.REVIEWS (REVIEW_ID,BANK_ID,REVIEW_TEXT,RATING,REVIEW_DATE,"SOURCE") VALUES
	 (986,3,TO_CLOB('A truly impressive app ‚Äî user-friendly and a game-changer in Ethiopian banking. The Dashen Super App stands out as one of the most innovative and convenient digital banking solutions in Ethiopia‚Äôs financial history. Smooth navigation, seamless features, and a wide range of services all in one place. Well done!'),5,TIMESTAMP'2025-04-21 00:00:00','Google Play'),
