	 (988,3,TO_CLOB('The Dashen Bank Super App has truly elevated my mobile banking experience. It''s fast, user-friendly, and packed with all the essential features. The interface is clean and intuitive, making navigation easy even for first-time users. I also appreciate the added security features that give me peace of mind while banking on the go. Dashen Bank has done an amazing job with this app‚Äîit‚Äôs reliable, efficient, and always improving. Highly recommended for anyone looking for seamless digital banking!'),5,TIMESTAMP'2025-04-21 00:00:00','Google Play'),
	 (989,3,TO_CLOB('A fantastic product!! keep the good work.'),5,TIMESTAMP'2025-04-21 00:00:00','Google Play'),
	 (990,3,TO_CLOB('I am very impressed with the Dashen super app. It is user-friendly and operates efficiently. The budget and chatbot features are impressive, and all items can be purchased with just three clicks.'),5,TIMESTAMP'2025-04-21 00:00:00','Google Play'),
	 (991,3,TO_CLOB('The Dashen Super App offers a quick and user-friendly experience, bringing together a variety of services, like budgeting, payments, airtime recharges, and more, all in one convenient platform. Its sleek design and intuitive navigation ensure effortless transactions. It''s evident that Dashen Bank has carefully crafted the app to make everyday financial activities easier. A great choice for anyone aiming to streamline their digital routines!'),5,TIMESTAMP'2025-04-21 00:00:00','Google Play'),
	 (992,3,TO_CLOB('Dashen supper App is the most useful app for our customers'),5,TIMESTAMP'2025-04-21 00:00:00','Google Play'),
