	 (995,3,TO_CLOB('Dear Users of the Dashen Bank Super App,I have been using the Dashen Bank Super App for a while now, and I must say‚Äîit‚Äôs truly a game-changer! The app is incredibly fast and reliable; I‚Äôve never encountered any delays with my transactions. One feature I absolutely love is Chat Banking. It makes everyday tasks like checking my balance or transferring money as simple as sending a quick message. Also, the budgeting tool has been a huge help in tracking my spending and giving me a clearer'),5,TIMESTAMP'2025-04-21 00:00:00','Google Play');
